    true,nt"url": null,nt"notes": "The Federal Parent Locator Service (FPLS)
    provides the Administration for Children and Families' Office of Child Support Enforcement
    (OCSE) with information for child support purposes, pertaining to parents for whom
    state child support agencies have requested FPLS conduct a locate. As part of FPLS
    this process contains two distinct exchanges, the Direct Request Locator Information
    File (DRLIF) and Earnings System Keyed Applications for SSN Registration Identification
    (ESKARI). In the DRLIF process, on a daily basis, OCSE submits a finder file of
    known SSNs to SSA to identify employer address information for up to ten recent
    employers the person has been employed by over the past four years as well as wage
    amounts. In the ESKARI process, on a daily basis OCSE submits finder files of unknown
    SSNs to SSA in order to identify the SSNs which will then be recycled back into
    the DRLIF process for normal processing.",nt"license_title": "Other License
